pub enum CursorPosition {
    Nowhere,
    At(ir::Inst),
    Before(ir::Block),
    After(ir::Block),
}

pub enum ExternalName {
    User {
        namespace: u32,
        index: u32,
    },
    TestCase {
        length: u8,
        ascii: [u8; ],
    },
    LibCall(LibCall),
}

pub enum FrameLayoutChange {
    CallFrameAddressAt {
        reg: RegUnit,
        offset: isize,
    },
    RegAt {
        reg: RegUnit,
        cfa_offset: isize,
    },
    ReturnAddressAt {
        cfa_offset: isize,
    },
    Preserve,
    Restore,
}

pub enum GlobalValueData {
    VMContext,
    Load {
        base: GlobalValue,
        offset: Offset32,
        global_type: Type,
        readonly: bool,
    },
    IAddImm {
        base: GlobalValue,
        offset: Imm64,
        global_type: Type,
    },
    Symbol {
        name: ExternalName,
        offset: Imm64,
        colocated: bool,
    },
}

pub enum HeapStyle {
    Dynamic {
        bound_gv: GlobalValue,
    },
    Static {
        bound: Uimm64,
    },
}

pub enum InstructionData {
    Binary {
        opcode: Opcode,
        args: [Value; ],
    },
    BinaryImm {
        opcode: Opcode,
        arg: Value,
        imm: ir::immediates::Imm64,
    },
    Branch {
        opcode: Opcode,
        args: ValueList,
        destination: ir::Block,
    },
    BranchFloat {
        opcode: Opcode,
        args: ValueList,
        cond: ir::condcodes::FloatCC,
        destination: ir::Block,
    },
    BranchIcmp {
        opcode: Opcode,
        args: ValueList,
        cond: ir::condcodes::IntCC,
        destination: ir::Block,
    },
    BranchInt {
        opcode: Opcode,
        args: ValueList,
        cond: ir::condcodes::IntCC,
        destination: ir::Block,
    },
    BranchTable {
        opcode: Opcode,
        arg: Value,
        destination: ir::Block,
        table: ir::JumpTable,
    },
    BranchTableBase {
        opcode: Opcode,
        table: ir::JumpTable,
    },
    BranchTableEntry {
        opcode: Opcode,
        args: [Value; ],
        imm: ir::immediates::Uimm8,
        table: ir::JumpTable,
    },
    Call {
        opcode: Opcode,
        args: ValueList,
        func_ref: ir::FuncRef,
    },
    CallIndirect {
        opcode: Opcode,
        args: ValueList,
        sig_ref: ir::SigRef,
    },
    CondTrap {
        opcode: Opcode,
        arg: Value,
        code: ir::TrapCode,
    },
    CopySpecial {
        opcode: Opcode,
        src: isa::RegUnit,
        dst: isa::RegUnit,
    },
    CopyToSsa {
        opcode: Opcode,
        src: isa::RegUnit,
    },
    ExtractLane {
        opcode: Opcode,
        arg: Value,
        lane: ir::immediates::Uimm8,
    },
    FloatCompare {
        opcode: Opcode,
        args: [Value; ],
        cond: ir::condcodes::FloatCC,
    },
    FloatCond {
        opcode: Opcode,
        arg: Value,
        cond: ir::condcodes::FloatCC,
    },
    FloatCondTrap {
        opcode: Opcode,
        arg: Value,
        cond: ir::condcodes::FloatCC,
        code: ir::TrapCode,
    },
    FuncAddr {
        opcode: Opcode,
        func_ref: ir::FuncRef,
    },
    HeapAddr {
        opcode: Opcode,
        arg: Value,
        heap: ir::Heap,
        imm: ir::immediates::Uimm32,
    },
    IndirectJump {
        opcode: Opcode,
        arg: Value,
        table: ir::JumpTable,
    },
    InsertLane {
        opcode: Opcode,
        args: [Value; ],
        lane: ir::immediates::Uimm8,
    },
    IntCompare {
        opcode: Opcode,
        args: [Value; ],
        cond: ir::condcodes::IntCC,
    },
    IntCompareImm {
        opcode: Opcode,
        arg: Value,
        cond: ir::condcodes::IntCC,
        imm: ir::immediates::Imm64,
    },
    IntCond {
        opcode: Opcode,
        arg: Value,
        cond: ir::condcodes::IntCC,
    },
    IntCondTrap {
        opcode: Opcode,
        arg: Value,
        cond: ir::condcodes::IntCC,
        code: ir::TrapCode,
    },
    IntSelect {
        opcode: Opcode,
        args: [Value; ],
        cond: ir::condcodes::IntCC,
    },
    Jump {
        opcode: Opcode,
        args: ValueList,
        destination: ir::Block,
    },
    Load {
        opcode: Opcode,
        arg: Value,
        flags: ir::MemFlags,
        offset: ir::immediates::Offset32,
    },
    LoadComplex {
        opcode: Opcode,
        args: ValueList,
        flags: ir::MemFlags,
        offset: ir::immediates::Offset32,
    },
    MultiAry {
        opcode: Opcode,
        args: ValueList,
    },
    NullAry {
        opcode: Opcode,
    },
    RegFill {
        opcode: Opcode,
        arg: Value,
        src: ir::StackSlot,
        dst: isa::RegUnit,
    },
    RegMove {
        opcode: Opcode,
        arg: Value,
        src: isa::RegUnit,
        dst: isa::RegUnit,
    },
    RegSpill {
        opcode: Opcode,
        arg: Value,
        src: isa::RegUnit,
        dst: ir::StackSlot,
    },
    Shuffle {
        opcode: Opcode,
        args: [Value; ],
        mask: ir::Immediate,
    },
    StackLoad {
        opcode: Opcode,
        stack_slot: ir::StackSlot,
        offset: ir::immediates::Offset32,
    },
    StackStore {
        opcode: Opcode,
        arg: Value,
        stack_slot: ir::StackSlot,
        offset: ir::immediates::Offset32,
    },
    Store {
        opcode: Opcode,
        args: [Value; ],
        flags: ir::MemFlags,
        offset: ir::immediates::Offset32,
    },
    StoreComplex {
        opcode: Opcode,
        args: ValueList,
        flags: ir::MemFlags,
        offset: ir::immediates::Offset32,
    },
    TableAddr {
        opcode: Opcode,
        arg: Value,
        table: ir::Table,
        offset: ir::immediates::Offset32,
    },
    Ternary {
        opcode: Opcode,
        args: [Value; ],
    },
    Trap {
        opcode: Opcode,
        code: ir::TrapCode,
    },
    Unary {
        opcode: Opcode,
        arg: Value,
    },
    UnaryBool {
        opcode: Opcode,
        imm: bool,
    },
    UnaryConst {
        opcode: Opcode,
        constant_handle: ir::Constant,
    },
    UnaryGlobalValue {
        opcode: Opcode,
        global_value: ir::GlobalValue,
    },
    UnaryIeee32 {
        opcode: Opcode,
        imm: ir::immediates::Ieee32,
    },
    UnaryIeee64 {
        opcode: Opcode,
        imm: ir::immediates::Ieee64,
    },
    UnaryImm {
        opcode: Opcode,
        imm: ir::immediates::Imm64,
    },
}

pub enum BranchInfo<'a> {
    NotABranch,
    SingleDest(Block, &'a [Value]),
    Table(JumpTable, Option<Block>),
}

pub enum CallInfo<'a> {
    NotACall,
    Direct(FuncRef, &'a [Value]),
    Indirect(SigRef, &'a [Value]),
}

pub enum ValueLabelAssignments {
    Starts(alloc::vec::Vec<ValueLabelStart>),
    Alias {
        from: SourceLoc,
        value: Value,
    },
}

pub enum Detail {
    Bool {
        bit: u8,
    },
    Num,
    Enum {
        last: u8,
        enumerators: u16,
    },
    Preset,
}

pub enum CodegenError {
    Verifier(VerifierErrors),
    ImplLimitExceeded,
    CodeTooLarge,
}
